import React from "react";
import { MenuStyle } from "../../../styles/FrontPageStyle/NavBar.style.ts";

function Menu() {
  return (
    <MenuStyle>
      <a href="www.dofus.com">Menu1</a>
      <a href="www.dofus.com">Menu2</a>
      <a href="www.dofus.com">Menu3</a>
    </MenuStyle>
  );
}

export default Menu;
